description:
Garmin OnRoute Fietskaart Nederland v1.55 (Mapsource version)
(Holland, the Netherlands)

Overview: This is the latest dutch Garmin GPS map made especially for bike
rides (a &quot;fietskaart&quot; in dutch). This map is fully routable compared to the
non routable dutch TOPO map.

Manufacturer's homepages: &lt;a href=&quot;
http://www.onroute.nl/fiets/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.onroute.nl/fiets/&lt;/a&gt; &lt;a href=&quot;
http://www.garmin.nl/product/?pid=SAI7500520&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.garmin.nl/product/?pid=SAI7500520&lt;/a&gt;

Install info:
Copy to c:Garminonroute and import Fietskaart.reg to the registry.
If you want to use different folder: edit Fietskaart.reg before importing!

Map Date: 13.02.2009

FID: 5142
Not locked map!
